Step-by-step reasoning:
1. Key psychological mechanisms: Responders typically care about receiving what they perceive as a “fair” share based on their contribution relative to their opponent’s. When the offered amount (split_self) is below this fairness benchmark, a penalty or loss in utility is incurred. In contrast, offers that meet or exceed one’s fair share do not trigger a penalty. This asymmetry reflects loss‐aversion in social fairness evaluation.
2. Mechanism interactions: The model computes a fairness benchmark F from the participant’s tokens relative to the total tokens multiplied by the combined earnings. When the monetary split offered is less than F, the discrepancy is penalized in proportion to the magnitude of the shortfall.
3. Mathematical form: We adopt a simple piecewise linear utility function. Specifically, the utility of accepting an offer is given as the actual monetary gain (split_self) minus a penalty term that is active only when split_self < F. In formula terms, that penalty is kappa times the positive difference max(F − split_self, 0).
4. Learnable parameter: The single learnable parameter, kappa, scales the penalty for disadvantageous inequality. It is bounded by finite limits (e.g., between 0 and 100). This single parameter keeps the model parsimonious and helps with parameter recovery.
5. Mapping to observable behavior: For each responder trial, the observed split_self and tokens (token_self and token_opp) determine the fairness benchmark F, and the model computes the utility U_accept. Negative values of U_accept will indicate an unlikely choice to accept the offer. No general stochasticity parameter is included because that will be added later via a temperature parameter.

Below is the formal specification:

<MODEL>
Let F = (token_self / (token_self + token_opp)) * combined_earning  
U_accept = split_self - kappa * max(F - split_self, 0)
</MODEL>

